import { Container, styled, Typography } from "@mui/material";

const CreatePollContainer = styled(Container)(({theme}) => ({
    paddingTop: theme.spacing(10)
}));

const CreatePollPage = () => {
    return(
        <CreatePollContainer>
            <Typography><Button 
                        variant="contained" 
                        disableElevation 
                        startIcon={<Poll /> }
                        >
                        Create poll
                    </Button></Typography>
        </CreatePollContainer>
    );
};

export default CreatePollPage;
